import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { ButtonModule } from 'primeng/button';
import { CardModule } from 'primeng/card';
import { CheckboxModule } from 'primeng/checkbox';
import { DialogModule } from 'primeng/dialog';
import { DynamicDialogModule, DynamicDialogConfig, DynamicDialogRef, DialogService } from 'primeng/dynamicdialog';
import { DividerModule } from 'primeng/divider';
import { InputTextModule } from 'primeng/inputtext';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { InputSwitchModule } from 'primeng/inputswitch';
import { SelectButtonModule } from 'primeng/selectbutton';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DateUtilsService } from 'app/core/util/date-utils.service';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';

import { CABComponent } from './cab.component';

@NgModule({
    declarations: [
      CABComponent,
    ],
    imports: [
      CommonModule,
      SharedModule,
      ButtonModule,
      CardModule,
      CheckboxModule,
      DialogModule,
      DynamicDialogModule,
      DividerModule,
      InputTextModule,
      InputTextareaModule,
      InputSwitchModule,
      SelectButtonModule
    ],
    exports: [
      CABComponent,
    ],
    providers: [
      DateUtilsService,
      DialogService,
      DynamicDialogRef,
      DynamicDialogConfig,
      MessageService,
      ConfirmationService,
      NspConfirmationService,
    ]
  })
  
  export class CABModule {}
